import styled from 'styled-components/native';

const OptionElement = styled.View`
  background-color: ${props => props.bubbleColor};
  padding-top: 12;
  padding-right: 12;
  padding-bottom: 12;
  padding-left: 12;
  border-radius: 22;
`;

export default OptionElement;
